import React, {} from 'react';
import classes from '../../CSS/Rankings.module.css';


const Rankings=()=>{
    return(
        <div className={classes.rankings}>
            <div className={classes.board}>
                <ul className={classes.player}>
                    <li>RANK</li>
                    <li>NAME</li>
                    <li>POINTS</li>
                </ul>
                {playerdata}
           </div>
        </div>
    )
}
export default Rankings
